import React, { useEffect, useState } from 'react';
import axios from 'axios';
import {
  Container, Typography, Box, Divider, Paper
} from '@mui/material';

const StatsPage = () => {
  const [stats, setStats] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:5000/stats').then(res => setStats(res.data));
  }, []);

  return (
    <Container sx={{ mt: 5 }}>
      <Typography variant="h3" gutterBottom align="center" sx={{ fontWeight: 'bold', mb: 4 }}>
        Shortened URL Stats
      </Typography>
      {stats.map(url => (
        <Paper key={url.code} elevation={4} sx={{ p: 3, mb: 4, borderRadius: 3, backgroundColor: 'background.paper' }}>
          <Typography variant="h6" sx={{ mb: 1 }}>
            Short URL: <a href={url.shortUrl}>{url.shortUrl}</a>
          </Typography>
          <Typography sx={{ mb: 1 }}>Original URL: {url.originalUrl}</Typography>
          <Typography sx={{ mb: 1 }}>Expires: {new Date(url.expiry).toLocaleString()}</Typography>
          <Typography sx={{ mb: 2 }}>Clicks: {url.clickCount}</Typography>
          {url.clicks.map((click, index) => (
            <Box key={index} ml={2} sx={{ mb: 0.5 }}>
              <Typography variant="body2">- {click.timestamp} | {click.source} | {click.location}</Typography>
            </Box>
          ))}
          <Divider sx={{ my: 2 }} />
        </Paper>
      ))}
    </Container>
  );
};

export default StatsPage;
